import React from 'react';
import styled from 'styled-components';

const Card = styled.div`
    width: 360px;
    height: 268px;
    background: #000;
    margin: 20px auto;
    display: block;
    position: relative;
`;

const Image = styled.div`
    width: 100%;
    height: 100%;
    overflow: hidden;

    img {
        width: 100%;
        transition: 0.5s;
    }

    ${Card}:hover & img {
        opacity: 0.5;
        transform: translateX(30%);
    }
`;

const Details = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    width: 65%;
    height: 100%;
    background: #ffc107;
    transition: 0.5s;
    transform-origin: left;
    transform: perspective(2000px) rotateY(-90deg);

    ${Card}:hover & {
        transform: perspective(2000px) rotateY(0deg);
    }
`;

const Center = styled.div`
    padding: 20px;
    text-align: center;
    background: #fff;
    position: absolute;
    top: 50%;
    width: 100%;
    transform: translateY(-50%);

    h1 {
        margin: 0;
        padding: 0;
        color: #ff3636;
        line-height: 20px;
        font-size: 20px;
        text-transform: uppercase;

        span {
            font-size: 14px;
            color: #262626;
        }
    }

    p {
        margin: 10px 0;
        padding: 0;
        color: #262626;
    }
`;

const Button = styled.button`
    background: #007bff;
    color: white;
    border: none;
    padding: 8px 16px;
    cursor: pointer;
    font-size: 14px;
    border-radius: 4px;
    margin-top: 10px;

    &:hover {
        background: #0056b3;
    }
`;

export default function MovieItem() {
    return (
        <Card>
            <Image>
                <img src="data:image/jpeg;base64," alt="movie poster" />
            </Image>
            <Details>
                <Center>
                    <h1>Movie Title<br /><span>movie genre</span></h1>
                    <Button>Get</Button>
                    <p>About Movie</p>
                </Center>
            </Details>
        </Card>
    );
}
